import React, { Component } from 'react';
import ColorBox from './ColorBox'
class Palette extends Component {
    render() {
        const ColorBox = this.props.map(colour => (
            <ColorBox background={colour} name={ColorBox.name}/>
        ))
        return (
            <div>
                {ColorBox}
            </div>
        )
    }
}

export default Palette;
